                if((j == 0 || j == 3) && paramWithRemoved.charAt(i-1) == '1'){
                    if(lastValue != null){
                        extensionAlgarisms.pop()
                        if(lastValue != '0'){
                            extensionAlgarisms.pop()
                        }
                        extensionAlgarisms.push(this.getFromDictionary(paramWithRemoved.charAt(i-1), j)[lastValue])
